import PropTypes from "prop-types"; // ES6
import { Container } from "./Section.module";

export const Section = ({ title, children }) => {
  return (
    <Container>
      {title} {children}
    </Container>
  );
};

Section.propTypes = {
  title: PropTypes.string.isRequired,
};
